import React from "react";
import ProductCard from "./ProductCard";

function Product(props) {
    return (
      // <React.Fragment>
        <div id="productGrid" class="container">
      <div class="row row-height">
        <div class="col-4">
          {/* <img class="img-size" src="https://pisces.bbystatic.com/image2/BestBuy_US/images/products/6268/6268404_sd.jpg;maxHeight=640;maxWidth=550"> */}
          <h2>Samsung 55' Ultra Smart tv</h2>
          <p class="price">Price: $<span class="priceAmount">527.99</span></p>
          <p>Step up from Full HD with the clarity of the UN55NU6900. Get 4X the resolution of Full HD, plus non-4K TV content is upscaled to 4K via a powerful UHD Engine. This TV is a clear upgrade for your content.</p>
          <button type="button" class="btn btn-primary" data-toggle="button" aria-pressed="false" autocomplete="off">Buy now</button>
        </div>

        <div class="col-4">
          {/* <img class="img-size" src="https://static.bhphotovideo.com/explora/sites/default/files/styles/top_shot/public/ts-2019-samsung-soundbar-systems_hw-r450_hw-r550_hw-r650_hw-q60r_1.jpg?itok=WgQnPCoH" alt="sound system"> */}
          <h2>Samsung Soundbar with Subwoofer</h2>
          <p class="price">Price: $<span class="priceAmount">399.99</span></p>
          <p>A wireless subwoofer delivers powerful low-end bass to enhance movies and songs, while a game mode enhances sound effects in your favorite games. This Samsung sound bar features six speakers with a dedicated center channel to provide crisp, clear dialog.</p>
          <button type="button" class="btn btn-primary" data-toggle="button" aria-pressed="false" autocomplete="off">Buy now</button>
        </div>

        <div class="col-4">
          {/* <img class="img-size" src="https://i5.walmartimages.com/asr/33de3a32-863c-4457-9cce-1fb65036d73c_1.93c6433ebb65dc7ef7d0a3d30dee21fc.jpeg?odnHeight=180&odnWidth=180&odnBg=FFFFFF"> */}
          <h2>Playstation 4 Pro</h2>
          <p class="price">Price: $<span class="priceAmount">373.45</span></p>
          <p>Support for faster frame rates delivers super-sharp action for select PS4 games. One unified gaming community. With up to 4K streaming and 4K auto-upscaling for video content.  For HD TV Enhanced games, players can benefit from increased image clarity a faster frame rates.</p>
          <button type="button" class="btn btn-primary" data-toggle="button" aria-pressed="false" autocomplete="off">Buy now</button>
        </div>
      </div>
      </div>
      // {/* </React.Fragment> */}
    )
}

export default Product;
